import React from "react";

import './Fotos.css';
import imageOne from "./../../artFoto/artOne.jpg";
import imageTwo from "./../../artFoto/artTwo.jpg";
import imageTre from "./../../artFoto/artTree.jpg";
import imageFiv from "./../../artFoto/artFiv.jpg";
import imageSix from "./../../artFoto/artSix.jpg";


const fotos = props => {
    let fotoClasses= 'foto-drawer';
    if(props.show) {
        fotoClasses= 'foto-drawer open';
    }
    return(
        <nav className={fotoClasses}>
            <div className="grid">
                <img src={imageOne} alt="nada" ></ img>
                <img href={ props.img } alt="importImage" />
            </div>
        </ nav>
    );
};


export default fotos;
